sourcesContent:
import mongoose from "mongoose";

const Schema = mongoose.Schema

const jobApplierSchema = new Schema({
    fullname: {
        type: String,
        required: true,
    },
    email: {
        type: String,
        required: true,
        unique: true,
    },
    phoneNumber: {
        type: Number,
        required: true,
    },
    password: {
        type: String,
        required: true,
    },
    location: {
        type: String,
        default: '',
    },
    headline: {
        type: String,
        default: '',
    },
    skills: {
        type: [String],
        require: true
    },
    experience: {
        type: [
            {
                company: String,
                role: String,
                startDate: Date,
                endDate: Date,
            },
        ],
        default: [],
    },
    education: {
        type: [
            {
                institution: String,
                degree: String,
                fieldOfStudy: String,
            },
        ],
        default: [],
    },
    status: {
        type: Number,
        default: 1,
    },
    createdAt: {
        type: Date,
        default: Date.now()
    },
})

export default mongoose.model("JobApplier", jobApplierSchema)

