sourcesContent:
import usersModel from "../models/users.model";

export const addUser = async (req, res) => {
    try {
        console.log(req.body)
        const { fullname, email, phoneNumber, password, location, headline, skills, experience, education, status } = req.body;
        const created = await usersModel.create({
            fullname: fullname,
            email: email,
            phoneNumber: phoneNumber,
            password: password,
            location: location,
            headline: headline,
            skills: skills,
            experience: experience,
            education: education,
            status: status
        });
        return res.status(200).json({
            data: created,
            message: 'Data Added',
            success: true
        })
    } catch (err) {
        return res.status(500).json({
            message: err.message,
            success: false
        })
    }
}

