sourcesContent:
import mongoose from "mongoose";

const Schema = mongoose.Schema;

const jobApplierSchema = new Schema({
    fullname: {
        type: String,
        required: true,
    },
    email: {
        type: String,
        required: true,
        unique: true,
    },
    phoneNumber: {
        type: String,
        required: true,
    },
    password: {
        type: String,
        required: true,
    },
    skills: {
        type: [String],
        required: true,
    },
    status: {
        type: Number,
        default: 1,
    },
    createdAt: {
        type: Date,
        default: Date.now,
    },
});

export default mongoose.model("JobApplier", jobApplierSchema);

