sourcesContent:
import JobApplier from "../models/JobApplier.model";

export const createJobApplier = async (req, res) => {
    try {
        console.log("test")
        console.log(req.body)
        const { fullname, email, contact, password, skills, image, status } = req.body;
        const created = await JobApplier.create({
            fullname: fullname,
            email: email,
            contact: contact,
            password: password,
            skills: skills,
            image: image,
            status: status
        });
        return res.status(200).json({
            data: created,
            message: 'Job applier cretaed succesfully',
            success: true
        })
    } catch (err) {
        return res.status(500).json({
            message: err.message,
            success: false
        })
    }
}

