sourcesContent:
import mongoose from "mongoose";

const Schema = mongoose.Schema;

const jobSchema = new Schema({
    fullname: {
        type: String,
        required: true,
    },
    email: {
        type: String,
        required: true,
    },
    contact: {
        type: Number,
        required: null,
    },
    password: {
        type: String,
        required: true,
    },
    skills: {
        type: [String],
        required: true,
    },
    image: {
        type: String,
        default: null
    },
    status: {
        type: Number,
        default: 1,
    },
    createdAt: {
        type: Date,
        default: Date.now()
    },
});

export default mongoose.model("JobApplier", jobSchema);

