import mongoose from "mongoose";

const Schema = mongoose.Schema;

const stdSchema = new Schema({
    name: {
        type: String,
        required: true,
    },
    email: {
        type: String,
        required: true,
    },
    password: {
        type: String,
        required: true,
    },
    contact: {
        type: Number,
        required: null,
    },
    image: {
        type: String,
        default: null
    },
    skills: {
        type: String,
        required: true,
    },
    status: {
        type: Number,
        default: 1,
    },
    createdAt: {
        type: Date,
        default: Date.now()
    },
});

export default mongoose.model("Student", stdSchema);

